import React from 'react';

const NextArrow = (props) => {
  const { className, style, onClick } = props;
  return (
    <div
      className={className}
      style={{ ...style, display: 'block', background: 'gray', borderRadius: '50%', padding: '10px', cursor: 'pointer' }}
      onClick={onClick}
    />
  );
};

